void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.x;


    float k  = mod(uv.x+uv.y,0.1)*4.0;
    vec2 u = uv*0.7;
    u+=iMouse.xy;
    float t = iTime*0.37;
    t += sin(cos(t*0.13)+1.0)+1.0;
    u-=t*0.2;
    float a = t*0.1;
    float f = sin(iTime*0.0321);
    u.x+=sin(a)*f;
    u.y+=cos(a)*f;
    u*=1.7;
    u.y+=1.5;
    float r = sin(mod(t*0.1+cos(uv.x*1.17)+1.0,.312)*4.0);
    vec3 col = (vec3(sin(u.x*1.34),cos(u.y*1.23),sin(u.x-u.y*2.0))+1.0)*0.6;
    vec3 ccol = (vec3( cos(u.x*1.74),sin(u.y*1.53),sin(u.x-u.y*3.123))+1.0)*0.7;
    float m = step(uv.x,iResolution.y/iResolution.x);
   fragColor = vec4(mix(col, ccol, m),1.0);
}
